class DataProcessor:
    def __init__(self, database):
        self.database = database

    def process_deletions(self, date):
        records_deleted = []
        for record in self.database:
            if record['date'] < date:
                self.database.remove(record)
                records_deleted.append(record)
        return records_deleted


