class ErrorLogger:
    @staticmethod
    def log_error(error_message, details):
        with open("error_log.txt", "a") as log_file:
            log_file.write(f"Error: {error_message}, Details: {details}\n")


class SubmissionManager:
    def __init__(self):
        self.submissions = {}

    def update_submission_status(self, submission_id, new_status):
        if submission_id in self.submissions:
            self.submissions[submission_id]['status'] = new_status
            print(f"Updated submission {submission_id} to status: {new_status}")
        else:
            print(f"Submission ID {submission_id} not found.")


